    false,nt"url": null,nt"notes": "These data are the summary statistics calculated
    for trees and snags from the three 0.05-ha circular plot habitat samples taken in
    2005 each at the 15 sample points at Spears and Didion Ranches, Placer County, California.
    There were three 0.05-ha circular habitat sampling plots at each of the 15 sample
    points. To be counted, trees had to be > 4" dbh and within the 12.6 m radius plot,
    while snags had to be > 4" dbh and > 9.8 ft tall and within the plot.",nt"license_title":
